	return (
		<>
			<div>
				<nav className="bg-blue-500">
					<h1 className="text-2xl">Jean Marques Vieira</h1>
					<ul className="flex items-end space-x-4">
						<li></li>
					</ul>
				</nav>
			</div>
		</>
	)
}

export default Navbar;
